Here is a C++ function that converts markdown to HTML:
```cpp
std::string markdownToHTML(const std::string& markdown) {
    std::string html;
    bool in_list = false;
    bool in_code = false;

    for (char c : markdown) {
        if (c == '*' && !in_code) {
            if (in_list) {
                html += "</li>";
                in_list = false;
            } else {
                html += "<li>";
                in_list = true;
            }
        } else if (c == '`' && !in_list) {
            if (in_code) {
                html += "</code>";
                in_code = false;
            } else {
                html += "<code>";
                in_code = true;
            }
        } else if (c == '#' && !in_list && !in_code) {
            html += "<h";
            html += std::to_string(markdown.find('#', 1) - 1);
            html += ">";
        } else if (c == '\n' && !in_list && !in_code) {
            html += "<br>";
        } else {
            html += c;
        }
    }

    if (in_list) html += "</li>";
    if (in_code) html += "</code>";

    return html;
}
```

This function does the following:

- Converts * at the start of a line to <li> and </li> for lists
- Converts ` to <code> and </code> for inline code blocks
- Converts # at the start of a line to <h1>, <h2>, <h3> etc for headings
- Converts newlines \n to <br> for line breaks 
- Leaves other characters unchanged
- Closes any open HTML tags at the end of the string

So this handles basic markdown formatting like lists, code, headings and line breaks. Let me know if you would like me to explain anything in the code!

